'use client'

import { useState } from 'react'
import { Moon, Sun } from 'lucide-react'

// Mock database
const mockDatabase = {
    table1: {
        schools: ['School A', 'School B', 'School C'],
        hours: ['9:00 AM', '10:00 AM', '11:00 AM', '12:00 PM'],
        teachers: ['Mr. Smith', 'Ms. Johnson', 'Mrs. Williams', 'Mr. Brown', 'Ms. Davis']
    },
    table2: {
        schools: ['School X', 'School Y', 'School Z'],
        hours: ['1:00 PM', '2:00 PM', '3:00 PM', '4:00 PM'],
        teachers: ['Dr. Lee', 'Prof. Garcia', 'Dr. Martinez', 'Prof. Taylor', 'Dr. Anderson']
    }
}

export default function Table() {
    const [currentTable, setCurrentTable] = useState('table1')
    const [schedule, setSchedule] = useState({})

    const { schools, hours, teachers } = mockDatabase[currentTable]

    const handleTeacherSelect = (school, hour, teacher) => {
        setSchedule((prev) => ({
            ...prev,
            [school]: {
                ...prev[school],
                [hour]: teacher
            }
        }))
    }

    return (
        <div className={`min-h-screen p-8`}>
            <div className="max-w-6xl mx-auto space-y-8">
                {/* Header */}
                <div className="flex justify-between items-center">
                    <h1 className="text-3xl font-bold">School Schedule</h1>
                    <div className="flex items-center space-x-4">
                        {/* Select Table */}
                        <select
                            value={currentTable}
                            onChange={(e) => setCurrentTable(e.target.value)}
                            className="p-2 border rounded w-[180px]"
                        >
                            <option value="table1">Table 1</option>
                            <option value="table2">Table 2</option>
                        </select>

                        {/* Dark Mode Toggle */}
                        <div className="flex items-center space-x-2">
                            <input
                                type="checkbox"
                                id="dark-mode"
                                checked={darkMode}
                                onChange={(e) => setDarkMode(e.target.checked)}
                                className="w-6 h-6"
                            />
                            <label htmlFor="dark-mode" className="cursor-pointer">
                                {darkMode ? <Moon className="h-4 w-4" /> : <Sun className="h-4 w-4" />}
                            </label>
                        </div>
                    </div>
                </div>

                {/* Schedule Table */}
                <div className="overflow-x-auto">
                    <table className="w-full bg-white dark:bg-gray-800 shadow-lg rounded-lg">
                        <thead>
                        <tr className="bg-gray-200 dark:bg-gray-700">
                            <th className="p-3">Hours</th>
                            {schools.map((school) => (
                                <th key={school} className="p-3">{school}</th>
                            ))}
                        </tr>
                        </thead>
                        <tbody>
                        {hours.map((hour) => (
                            <tr key={hour} className="border-b dark:border-gray-600">
                                <td className="p-3 font-medium">{hour}</td>
                                {schools.map((school) => (
                                    <td key={`${school}-${hour}`} className="p-3">
                                        <select
                                            className="p-2 border rounded w-full"
                                            value={schedule[school]?.[hour] || ''}
                                            onChange={(e) =>
                                                handleTeacherSelect(school, hour, e.target.value)
                                            }
                                        >
                                            <option value="">Select Teacher</option>
                                            {teachers.map((teacher) => (
                                                <option key={teacher} value={teacher}>
                                                    {teacher}
                                                </option>
                                            ))}
                                        </select>
                                    </td>
                                ))}
                            </tr>
                        ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    )
}
